My favorite things to buy at Costco:

@madegoodfoods granola balls (for our nut free school) and for extra curricular activities. 
@chomps beef jerky. No sugar and 100% grass-fed. 
@onedegreeorganics sprouted rolled oats. Sprouted means higher bioavailability (more available nutrients) and less starch so it makes it easier to digest. 
@perfectbar our family loves them. Great for convenience / high in protein. 
@lovesuja green juice for convenience. 
@raoshomemade marinara sauce for the endless pasta nights. 
@thatsit fruit bars. The best to keep in your bag for when hunger hits especially for your kiddos. 
@sietefoods almond flour tortillas. Just the best especially for quesadillas. 
@costco organic frozen fruit, almond butter, maple syrup, coconut water. 

⚡️Grab my FREE grocery list to make sure you don’t miss a thing while also giving you structure to buy the things that you need. Remember to shop the outer aisles first to save money. Link is in my bio. 

